import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = 'Alex Bogdanov';

    return (
      <div className='App'>
        <h1>Hello {name}</h1>
        <label htmlFor='Name'>Name</label>
      </div>
    );
  }
}

export default App;
